import { Component, Vue } from "vue-property-decorator";
import { State, Mutation } from "vuex-class";

@Component({
  components: {}
})
export default class BaseMenu extends Vue {
  @Mutation("add_editableTabs") private add_editableTabs: any;
  private isCollapse: Boolean = false;
  private menuList: any = [
    {
      title: "订单管理",
      name: "order",
      children: [
        {
          title: "订单列表",
          name: "order-list"
        },
        {
          title: "订单历史",
          name: "order-history"
        },
        {
          title: "帐变列表",
          name: "order-change"
        }
      ]
    },
    {
      title: "下发管理",
      name: "dispatch",
      children: [
        {
          title: "下发申请",
          name: "dispatch-apply"
        },
        {
          title: "下发列表",
          name: "dispatch-list"
        },
        {
          title: "下发银行卡管理",
          name: "dispatch-bankcard"
        }
      ]
    },
    {
      title: "公告管理",
      name: "info",
      // children: [
      //   {
      //     title: "下发列表",
      //     name: "dispatch-list"
      //   },
      //   {
      //     title: "下发历史",
      //     name: "dispatch-history"
      //   }
      // ]
    },
    // {
    //   title: "公告列表",
    //   name: "list",
    //   children: [
    //     {
    //       title: "下发列表",
    //       name: "dispatch-list"
    //     },
    //     {
    //       title: "下发历史",
    //       name: "dispatch-history"
    //     }
    //   ]
    // }
  ];
  handleOpen(key: any, keyPath: any) {
    console.log(key, keyPath);
  }
  handleClose(key: any, keyPath: any) {
    console.log(key, keyPath);
  }
  addTabList(item: any, child: any) {
    this.add_editableTabs({
      title: child.title,
      url: `/home/table/1/${item.title}/${child.title}`
    });
    this.$router.push({ path: `/home/table/1/${item.title}/${child.title}` });
  }
}
